// --- Function to copy the array(s) into the provided string buffer.
// --- Buffer size is not checked, as MakeCARR makes sure it's sufficient.
// ---------------------------------------------------------------------
void ReadJMLData(char *Buffer)
{
    memcpy(Buffer, &JMLL0[1], JMLL0[0] << 2);
    Buffer += (JMLL0[0] << 2);

    memcpy(Buffer, &JMLL1[1], JMLL1[0] << 2);
    Buffer += (JMLL1[0] << 2);

    memcpy(Buffer, &JMLL2[1], JMLL2[0] << 2);
    Buffer += (JMLL2[0] << 2);

    memcpy(Buffer, &JMLL3[1], JMLL3[0] << 2);
    Buffer += (JMLL3[0] << 2);

    memcpy(Buffer, &JMLL4[1], JMLL4[0] << 2);
    Buffer += (JMLL4[0] << 2);

    memcpy(Buffer, &JMLB[1], JMLB[0]);
}

// --- Saved full qualified output path and filename, so we've no troubles
// --- when cleaning up, even if the current working folder was changed
// --- during program runtime.
// ---------------------------------------------------------------------
char JMLName[8192]; // it's a safe size for any current OS

// --- Cleanup function to delete the written file, called by the atexit()
// --- handler at program termination time, if requested by user.
// ---------------------------------------------------------------------
void KillJMLData(void)
{
    remove(JMLName);
}

// --- Function to write the array(s) back into a file, will return the
// --- full qualified output path and filename on success, otherwise an
// --- empty string is returned (access/write errors, file truncated).
// ---------------------------------------------------------------------
const char *WriteJMLData(const char *FileName, int16_t AutoClean)
{
    FILE   *han = NULL; // file handle
    int32_t num = NULL; // written elements

    #ifdef QB64_WINDOWS
    if (!_fullpath(JMLName, FileName, 8192)) return "";
    #else
    if (!realpath(FileName, JMLName)) return "";
    #endif

    if (!(han = fopen(JMLName, "wb"))) return "";
    if (AutoClean) atexit(KillJMLData);

    num = fwrite(&JMLL0[1], 4, JMLL0[0], han);
    if (num != JMLL0[0]) {fclose(han); return "";}

    num = fwrite(&JMLL1[1], 4, JMLL1[0], han);
    if (num != JMLL1[0]) {fclose(han); return "";}

    num = fwrite(&JMLL2[1], 4, JMLL2[0], han);
    if (num != JMLL2[0]) {fclose(han); return "";}

    num = fwrite(&JMLL3[1], 4, JMLL3[0], han);
    if (num != JMLL3[0]) {fclose(han); return "";}

    num = fwrite(&JMLL4[1], 4, JMLL4[0], han);
    if (num != JMLL4[0]) {fclose(han); return "";}

    num = fwrite(&JMLB[1], 1, JMLB[0], han);
    if (num != JMLB[0]) {fclose(han); return "";}

    fclose(han);
    return JMLName;
}

